INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 7, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 0, 1, 0.0, 7001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 7, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 0, 1, 0.0, 7002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 7, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 0, 1, 0.0, 7003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 10, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 0, 1, 0.0, 10001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 10, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 0, 1, 0.0, 10002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 10, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 0, 1, 0.0, 10003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 10, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 2104010, 1, 0.0, 10004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 12, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 0, 1, 0.0, 12001, 0, -416.5);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 13, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 0, 1, 0.0, 13001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 13, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 0, 1, 0.0, 13002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 13, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 2104010, 1, 0.0, 13003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 13, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 0, 1, 0.0, 13004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 14, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 0, 1, 0.0, 14001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 14, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 2104010, 1, 0.0, 14002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 14, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 0, 1, 0.0, 14003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 14, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 0, 1, 0.0, 14004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 15, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 0, 1, 0.0, 15001, 0, -470.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 16, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 2104010, 1, 0.0, 16001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 16, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 0, 1, 0.0, 16002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 16, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 0, 1, 0.0, 16003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 16, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 0, 1, 0.0, 16004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 17, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 0, 1, 0.0, 17002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 25, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 0, 1, 0.0, 17004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 25, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 0, 1, 0.0, 17005, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 25, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 2104010, 1, 0.0, 17006, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 25, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 0, 1, 0.0, 17007, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 1, 18, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 0, 1, 0.0, 18001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 2, 18, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 0, 1, 0.0, 18002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 3, 19, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 0, 1, 0.0, 19001, 0, -470.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 4, 19, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 0, 1, 0.0, 19002, 0, -470.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 5, 20, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 0, 1, 0.0, 20001, 0, -470.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 6, 20, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 0, 1, 0.0, 20002, 0, -470.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 21, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 0, 1, 0.0, 21001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 21, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 0, 1, 0.0, 21002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 21, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 2104010, 1, 0.0, 21003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 21, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 0, 1, 0.0, 21004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 1, 22, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 0, 1, 0.0, 22001, 0, -430.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 2, 22, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 0, 1, 0.0, 22002, 0, -430.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 3, 23, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 0, 1, 0.0, 23001, 0, -430.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (190801, 1, 4, 23, "2015/12/17 15:00:00", "カリン", "2030/12/17 14:59:59", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 0, 1, 0.0, 23002, 0, -430.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109001, 1, 1, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 4.08, 0, 2, 8.0, 24001, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109001, 1, 2, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, 0, 2, 8.0, 24002, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109001, 1, 3, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, 0, 2, 8.0, 24003, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109001, 1, 4, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, 0, 2, 8.0, 24004, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109001, 1, 5, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, 0, 2, 8.0, 24005, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109002, 1, 6, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 0, 1, 0.0, 24006, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109002, 1, 7, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 0, 1, 0.0, 24007, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109002, 1, 8, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 0, 1, 0.0, 24008, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109002, 1, 9, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 0, 1, 0.0, 24009, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109002, 1, 10, 24, "2019/01/31 12:00:00", "エリコ（バレンタイン）", "2030/12/17 14:59:59", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 0, 1, 0.0, 24010, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109101, 1, 1, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2.12, 0, 2, 8.0, 24011, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109101, 5, 2, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 4.19, 0, 2, 8.0, 24012, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109101, 2, 3, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2.3, 0, 4, 8.0, 24013, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109102, 1, 4, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 0, 1, 0.0, 24014, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109101, 5, 5, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5.23, 0, 2, 8.0, 24015, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109102, 1, 6, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 0, 1, 0.0, 24016, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109101, 1, 7, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 5.01, 0, 2, 8.0, 24017, 10011, -385.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109102, 1, 8, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 0, 1, 0.0, 24018, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109102, 1, 9, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 0, 1, 0.0, 24019, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (109102, 1, 10, 24, "2019/01/31 12:00:00", "シズル（バレンタイン）", "2030/12/17 14:59:59", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 0, 1, 0.0, 24020, 10011, 0.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 26, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, 2104010, 1, 0.0, 26001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 26, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0.0, 0, 1, 0.0, 26002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 26, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0.0, 0, 1, 0.0, 26003, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 26, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0.0, 0, 1, 0.0, 26004, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106401, 2, 1, 27, "2015/12/17 15:00:00", "シェフィ", "2030/12/17 14:59:59", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 0.0, 2104010, 1, 0.0, 27001, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 27, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0.0, 0, 1, 0.0, 27002, 0, -363.0);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 27, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0.0, 0, 1, 0.0, 27003, 0, -363.0);
