INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105901, 1, 1, 41, "2015/12/17 15:00:00", "コッコロ", "2030/12/17 14:59:59", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0.0, 0, 1, 0.0, 41004, 0, -363.0);
