INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (106001, 1, 1, 42, "2015/12/17 15:00:00", "キャル", "2030/12/17 14:59:59", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0.0, 0, 1, 0.0, 42004, 0, -416.5);
INSERT INTO `v1_8a124878c0167062dc99b186929b5b6a1de96180f8d24a0652a40103ce5d5a76` VALUES (105801, 1, 1, 43, "2015/12/17 15:00:00", "ペコリーヌ", "2030/12/17 14:59:59", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0.0, 0, 1, 0.0, 43001, 0, -363.0);
